import React, { Component } from 'react';

const User = (props) =>{
    return (
        <div>
           < p
                      style={{
                        position:'absolute',
                        padding:'5px 10px',
                        height:'25px',
                        lineHeight:'25px',
                        borderRadius:'3px',
                        backgroundColor:'white',
                        color:'black',
                        bottom:'5%',
                        left:'2%',

                      }}
                    >{props.userName}</p>
        </div>
    )
}

export default User;
